import React, { useState } from 'react';
import './Dashboard.css'; // Make sure this file exists and styles .dashboard

const AdminDashboard = () => {
  const [results, setResults] = useState([
    { id: 1, name: 'Alice', subject: 'Math', score: 85 },
    { id: 2, name: 'Bob', subject: 'Science', score: 90 },
    { id: 3, name: 'Charlie', subject: 'English', score: 78 }
  ]);

  const handleDelete = (id) => {
    setResults(results.filter((r) => r.id !== id));
  };

  return (
    <div className="dashboard">
      <h2>Admin Dashboard</h2>
      <table className="dashboard-table">
        <thead>
          <tr>
            <th>Student</th>
            <th>Subject</th>
            <th>Score</th>
            <th>Action</th>
          </tr>
        </thead>
        <tbody>
          {results.map((r) => (
            <tr key={r.id}>
              <td>{r.name}</td>
              <td>{r.subject}</td>
              <td>{r.score}</td>
              <td>
                <button className="delete-btn" onClick={() => handleDelete(r.id)}>Delete</button>
              </td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
};

export default AdminDashboard;
